import Statistics from './Statistics'

function StatisticList({ items }) {
  return (
    <ul>
      {items.map((item) => (
        <li key={item.id}>
          <Statistics label={item.label} stats={item.percentage} />
        </li>
      ))}
    </ul>
  )
}

export default StatisticList
